INSERT INTO `seguimiento` (`idseguimiento`, `idpersona`, `idevento`, `fecha`, `idtiposeguimiento`, `comentario`) VALUES
(1, 11, 33, '2022-05-18', 2, '<p>&lt;html&gt;<br>&nbsp; &lt;head&gt;<br>&lt;link rel=\"stylesheet\" href=\"https://maxst.icons8.com/vue-static/landings/line-awesome/line-awesome/1.3.0/css/line-awesome.min.css\"&gt;</p>\n<p>&lt;style type=\"text/css\"&gt;<br>&nbsp;.video-wrapper {display:none;}<br>&nbsp;@media (-webkit-min-device-pixel-ratio: 0) and (min-device-width:1024px)&nbsp;<br>&nbsp;{<br>&nbsp; .video-wrapper { display:block!important; }<br>&nbsp; .video-fallback { display:none!important; }<br>&nbsp;}<br>&nbsp; @supports (-webkit-overflow-scrolling:touch) and (color:#ffffffff) {<br>&nbsp; &nbsp; div[class^=video-wrapper] { display:block!important; }<br>&nbsp; &nbsp; div[class^=video-fallback] { display:none!important; }<br>&nbsp; }<br>&nbsp; #MessageViewBody .video-wrapper { display:block!important; }<br>&nbsp; #MessageViewBody .video-fallback { display:none!important; }<br>&lt;/style&gt;</p>\n<p>&nbsp;</p>\n<p>&nbsp; &lt;/head&gt;<br>&lt;body&gt;<br>&nbsp; &lt;div style=\"margin: auto; width:80%;\"&gt;<br>&nbsp; &lt;p style=\'font-size:1.5vw;\'&gt;Hola,&nbsp; tenemos &lt;u&gt;&lt;span style=\'color: green; font-weight: bold;\' &gt; buenas noticias &lt;/span&gt;&lt;/u&gt;; con una visi&oacute;n m&aacute;s amplia comenzamos el siguiente proceso de la postulaci&oacute;n a la Maestr&iacute;a en Tecnolog&iacute;a de la Informaci&oacute;n. &lt;/p&gt;&nbsp;<br>&nbsp; &lt;/div&gt; &nbsp;&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &lt;div &nbsp;style=\'background-color: #DAF7A6; border-bottom-left-radius:50px 50px; border-top-right-radius: 50px 50px; &nbsp;border:1px solid green; &nbsp;opacity:0.5; text-align:justify; width:80%; margin:auto; box-shadow: 0px 10px 10px -6px black; \'&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;div style=\"padding:20px;\"&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;p style=\'font-size:1.5vw\' &gt;Esta parte del proceso consiste en 4 etapas que se las ejecutar&aacute; en este mes de julio y consiste de:&lt;/p&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;ol style=\"font-size:1.5vw\"&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;li&gt; Calificaci&oacute;n de tus m&eacute;ritos a trav&eacute;s de tu carpeta.&lt;/li&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;li&gt; Una prueba de conocimientos.&lt;/li&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;li&gt; Una entrevista. &lt;/li&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;li&gt; Pago del valor de la &nbsp;matricula. &lt;/li&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;/ol&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;p style=\"font-size:1.5vw\"&gt;Despu&eacute;s de superar estas 4 etapas comenzamos las clases el 29 de julio. &lt;/p&gt;&lt;/br&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;p style=\"font-size:1.5vw\"&gt;&lt;span style=\'color: blue; font-weight: bold;\' &gt; &nbsp;Solo necesitamos que nos confirmes v&iacute;a correo &nbsp;que a&uacute;n estas interesado en seguir la maestr&iacute;a; te enviaremos una invitaci&oacute;n a una capacitaci&oacute;n gratuita previo a iniciar los estudios regulares para ayudarte &nbsp;a comenzar con pie derecho esta traves&iacute;a. &lt;/span&gt; &lt;/p&gt;&lt;br&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;center&gt;(calendario &lt;span style=\"font-size:80px\"&gt; &amp;#9759;&lt;/span&gt; &nbsp;general)&lt;/center&gt; &nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;/div&gt;<br>&lt;/div&gt;<br>&lt;br&gt;</p>\n<p><br>&lt;center&gt; &lt;img src=\"http://educaysoft.org/maestria/postulacion3-la-final.jpg\" width=\"80%\" &gt;&lt;/center&gt;&lt;br&gt;</p>\n<p>&lt;br&gt;</p>\n<p>&lt;/body&gt;<br>&lt;/html&gt;</p>'),
