(15, 8, 33, '2022-06-17', 2, '<p>Saludo &lt;b&gt;Stalin&lt;/b&gt;&lt;br&gt;</p>\n<p>Nos estamos renovando y preparando para iniciar la primera corte de la &lt;b&gt;Maestr&iacute;a en Tecnolog&iacute;a de la Informaci&oacute;n&lt;/b&gt;, las carpetas de los aspirantes a esta maestr&iacute;a estan siendo recibidas en la &lt;b&gt;Oficina de Postgrado&lt;b&gt; en la&nbsp; Sede Nuevos Horizontes.&lt;br&gt;</p>\n<p>Si estas leyendo este mensaje es por que tu estado actual es el siguiente:</p>\n<p>&nbsp;</p>\n<p>&lt;ol&gt;</p>\n<p>&lt;li&gt;Si ya entregaste tu carpeta solo debes esperar a que te llamemos para comenzar el proceso de admisi&oacute;n.&lt;/li&gt;</p>\n<p>&lt;li&gt;Si ya entregaste tu carpeta pero por la espera&nbsp; decidistes&nbsp; buscar otra alternativa,&nbsp; nos ayudar&iacute;a comunicanos de tu decision.&lt;/li&gt;</p>\n<p>&lt;li&gt;Si no has entragado tu carpeta a&uacute;n puedes hacerlo, hasta finales de este mes de junio.&lt;/li&gt;</p>\n<p>&lt;/ol&gt;</p>\n<p>Para m&aacute;s informaci&oacute;n de la maestria click &lt;a href=\" https://educaysoft.org/sica/MTI/doc/_build/html/\"&gt; Aqui&lt;/a&gt; &lt;br&gt;&lt;br&gt;</p>\n<p>&lt;b&gt;Contactos:&lt;b&gt;&lt;br&gt;</p>\n<p>Cordinador: Ing. Stalin Francis :&nbsp; 0801560517&lt;br&gt;</p>\n<p>Oficina de Postgrado: Ing. Miguel Cueva: 0961026380&lt;br&gt;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>'),
